import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom"

import LoginPage from "./pages/login"
import Profile from './pages/profile'
import ShowRecipe from './pages/recipe'
import AddRecipe from './pages/recipeForm'
import RecipeSearch from './pages/recipeSearch'



class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
        </div>

        <Route path="/" exact component={LoginPage}/>
        <Route path="/profile" component={Profile}/>
        <Route exact path="recipes" component={RecipeSearch}/>
        <Route exact path="recipe/new" component={AddRecipe}/>
        <Route exact path="recipe/:id" component={ShowRecipe}/>
      </Router>
    );
  }
}

export default App;
